double naive(int N, int K, int T)
{
    vector<int> P(N);
    for (int i=0; i<N; i++)
        P[i] = i;


    int c = 0;
    int n = 0;

    do
    {
        int k = 0;
        int m = -1;
        bool ok = false;
        for (int j=0; j<N; j++)
        {
            if (P[j]>m)
            {
                if (j>=T && k<K)
                {
                    if (P[j]==N-1)
                    {
                        ok = true;
                        break;
                    }
                    k++;
                }
            }
            m = max(P[j], m);
        }
        if (ok)
            c++;
        n++;
    }
    while (next_permutation(P.begin(), P.end()));

    return (double)c/n;
}

