double solve1(int N, int K)
{
    vector<int> kd(N);

    function<double(int, int)> f1 = [&](int i, int k)
    {
        if (i>=N)
        {
            //  i番目の時点で食べたせんべいがKK[i]未満なら食べる
            vector<int> KK(N);
            KK[0] = kd[0];
            for (int i=1; i<N; i++)
                KK[i] = KK[i-1]+kd[i];

            vector<vector<vector<double>>> memo(N, vector<vector<double>>(N, vector<double>(K+1, -1.)));
            //  i番目で、それまでの最高がm-1で、k枚食べている場合の確率
            function<double(int, int, int)> f2 = [&](int i, int m, int k)
            {
                if (i>=N)
                    return 0.;

                if (memo[i][m][k]>=0.)
                    return memo[i][m][k];

                double ans = 0.;

                ans += (double)(m-i)/(N-i) * f2(i+1, m, k);

                if (k<KK[i])
                {
                    for (int j=m; j<N-1; j++)
                        ans += 1./(N-i) * f2(i+1, j+1, k+1);
                    ans += 1./(N-i);
                }
                else
                {
                    for (int j=m; j<N-1; j++)
                        ans += 1./(N-i) * f2(i+1, j+1, k);
                }

                return ans;
            };

            return f2(0, 0, 0);
        }

        if (i>=N)
            return 0.;

        double ans = f1(i+1, k);

        if (k>0)
        {
            kd[i] = 1;
            double a = f1(i+1, k-1);
            ans = max(ans, a);
            kd[i] = 0;
        }
        return ans;
    };

    return f1(0, K);
}

double solve2(int N, int K)
{
    vector<int> kd(N);

    function<double(int, int)> f1 = [&](int i, int k)
    {
        if (i>=N)
        {
            //  i番目の時点で食べたせんべいがKK[i]未満なら食べる
            vector<int> KK(N);
            KK[0] = kd[0];
            for (int i=1; i<N; i++)
                KK[i] = KK[i-1]+kd[i];

            vector<vector<vector<double>>> T(N, vector<vector<double>>(N, vector<double>(K+1)));
            for (int k=0; k<KK[N-1]; k++)
                T[N-1][N-1][k] = 1.;
            for (int i=N-2; i>=0; i--)
                for (int m=i; m<N; m++)
                    for (int k=0; k<=KK[i]; k++)
                    {
                        T[i][m][k] += (m-i)*T[i+1][m][k];
                        if (k<KK[i])
                        {
                            for (int j=m; j<N-1; j++)
                                T[i][m][k] += T[i+1][j+1][k+1];
                            T[i][m][k] += 1.;
                        }
                        else
                        {
                            for (int j=m; j<N-1; j++)
                                T[i][m][k] += T[i+1][j+1][k];
                        }
                        T[i][m][k] /= N-i;
                    }

            return T[0][0][0];
        }

        if (i>=N)
            return 0.;

        double ans = f1(i+1, k);

        if (k>0)
        {
            kd[i] = 1;
            double a = f1(i+1, k-1);
            ans = max(ans, a);
            kd[i] = 0;
        }
        return ans;
    };

    return f1(0, K);
}

double solve3(int N, int K)
{
    if (N==0 || K==0)
        return 0.;

    //  MP[x][y]: x番目の直前で最大値がy-1である確率
    vector<vector<double>> MP(N, vector<double>(N+1));
    MP[0][0] = 1.;
    for (int i=1; i<N; i++)
    {
        double p = MP[i-1][i-1];
        for (int j=i; j<=N; j++)
        {
            MP[i][j] += ((j-i+1)*MP[i-1][j] + p)/(N-i+1);
            p += MP[i-1][j];
        }
    }

    vector<vector<vector<vector<double>>>> T(N, vector<vector<vector<double>>>(K+1, vector<vector<double>>(N, vector<double>(K+1))));
    vector<vector<vector<vector<double>>>> S(N, vector<vector<vector<double>>>(K+1, vector<vector<double>>(N+1, vector<double>(K+1))));

    for (int kk=0; kk<=K; kk++)
        for (int k=0; k<K; k++)
            T[N-1][kk][N-1][k] = 1.;
    for (int kk=0; kk<=K; kk++)
        for (int m=0; m<N; m++)
            for (int k=0; k<=K; k++)
                S[N-1][kk][m+1][k] = S[N-1][kk][m][k] + T[N-1][kk][m][k];

    for (int i=N-2; i>=0; i--)
    {
        for (int kk=0; kk<=K; kk++)
        {
            double kp[2] = {};

            for (int kd=0; kd<2 && kk+kd<=K; kd++)
            {
                for (int m=i; m<N; m++)
                {
                    double t = 0.;
                    t += (m-i)*T[i+1][kk+kd][m][kk];
                    if (kd>0)
                    {
                        //for (int j=m; j<N-1; j++)
                        //    t += T[i+1][kk+kd][j+1][kk+1];
                        t += S[i+1][kk+kd][N][kk+1] - S[i+1][kk+kd][m+1][kk+1];
                        t += 1.;
                    }
                    else
                    {
                        //for (int j=m; j<N-1; j++)
                        //    t += T[i+1][kk+kd][j+1][kk];
                        t += S[i+1][kk+kd][N][kk] - S[i+1][kk+kd][m+1][kk];
                    }
                    kp[kd] += t*MP[i][m];
                }
            }

            int kd = kp[0]>=kp[1] ? 0 : 1;

            for (int m=i; m<N; m++)
                for (int k=0; k<=kk+kd; k++)
                {
                    double t = 0.;
                    t += (m-i)*T[i+1][kk+kd][m][k];
                    if (k<kk+kd)
                    {
                        //for (int j=m+1; j<N; j++)
                        //    t += T[i+1][kk+kd][j][k+1];
                        t += S[i+1][kk+kd][N][k+1] - S[i+1][kk+kd][m+1][k+1];
                        t += 1.;
                    }
                    else
                    {
                        //for (int j=m+1; j<N; j++)
                        //    t += T[i+1][kk+kd][j][k];
                        t += S[i+1][kk+kd][N][k] - S[i+1][kk+kd][m+1][k];
                    }
                    t /= N-i;
                    T[i][kk][m][k] = t;
                }
        }

        for (int kk=0; kk<=K; kk++)
            for (int m=0; m<N; m++)
                for (int k=0; k<=K; k++)
                    S[i][kk][m+1][k] = S[i][kk][m][k] + T[i][kk][m][k];
    }

    return T[0][0][0][0];
}

